  uri: "https://vm8mjvrnv3.lp.gql.zone/graphql"
});

function App() {
  return (
    <ApolloProvider client={client}>
      <div>
        <h2>My First Apollo React Application</h2>
      </div>
    </ApolloProvider>
  );
}

export default App;
